// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awBackButtonRenderFunction } from 'js/AwBackButtonService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwBackButtonService', () => import('js/AwBackButtonService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awBackButtonRenderFunction",
            "deps": "js/AwBackButtonService"
        }
    },
    "data": {
        "backCommand": {
            "iconName": "Back",
            "tooltip": ""
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "BACK_BUTTON_TITLE": [
            "BaseMessages"
        ]
    },
    "props": {
        "title": {
            "type": "string"
        },
        "action": {
            "type": "action"
        },
        "pre-panel-id": {
            "type": "string"
        }
    },
    "_viewModelId": "AwBackButton",
    "_uniqueViewModelId": "AwBackButton",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awBackButtonRenderFunction, undefined, ctxImportObj );

export default Component;
